function codeTranslate(e){switch(e=parseInt(e)){case 0:return"wi-tornado";case 1:case 2:return"wi-hurricane";case 3:case 4:return"wi-thunderstorm";case 5:case 6:case 7:return"wi-rain-mix";case 8:return"wi-hail";case 9:return"wi-sprinkle";case 10:return"wi-hail";case 11:case 12:return"wi-showers";case 13:case 14:return"wi-snow";case 15:return"wi-snow-wind";case 16:return"wi-snow";case 17:case 18:return"wi-hail";case 19:case 20:case 21:case 22:return"wi-fog";case 23:return"wi-cloudy-gusts";case 24:return"wi-cloudy-windy";case 25:return"wi-thermometer-exterior";case 26:return"wi-cloudy";case 27:return"wi-night-cloudy";case 28:return"wi-day-cloudy";case 29:return"wi-night-cloudy";case 30:return"wi-day-cloudy";case 31:return"wi-night-clear";case 32:return"wi-day-sunny";case 33:return"wi-night-clear";case 34:return"wi-day-sunny-overcast";case 35:return"wi-rain-mix";case 36:return"wi-day-sunny";case 37:case 38:case 39:case 40:return"wi-thunderstorm";case 41:case 42:case 43:return"wi-snow";case 44:return"wi-day-cloudy";case 45:return"wi-storm-showers";case 46:return"wi-snow";case 47:return"wi-thunderstorm";case 3200:return"wi-cloud";default:return""}}function pintarForecast(e,r,s,a,c){$(a+" .forecast").append('<div class="col-sm-'+e+' mb-30 day"><div><div class="mb-10">'+c+'</div><i class="wi  '+codeTranslate(r.code)+' font-size-30 mb-10"></i><div><i class="wi wi-thermometer"></i> '+r.high+'ยบ<span class="font-size-12">'+s+'   </span><i class="wi wi-thermometer-exterior"></i> '+r.low+'ยบ<span class="font-size-12">'+s+"</span></div></div></div>")}